import React from "react";
import temple from '../pics/temple.jpg'
const SignUp = () => {
  return (


    <div class="container flex justify-center align-middle mx-auto ">
        <div class="left ">
            <img className="w-full"src={temple} alt="temple"/>

        </div>
        <div class="right w-1/3 flex flex-col mx- bg-white p-9 justify-center border border-gray-300">
            <input type="text" class="w-82 px-4 py-3 mb-2 rounded-md border border-1"  placeholder="Enter your email adress or phone number"/>
             <input type="text" class="w-82  px-4 py-2 mb-2 rounded-md border border-1"placeholder="Password"/>
             <button class="bg bg-blue-600 hover:bg-blue-700 rounded sm w-82 py-2 text-white "> Log In</button>
             <span class="mx-2 text-xs hover:underline m-1 ">Forgotten Password</span>
             <hr/>
             <button class="bg bg-green-600 py-2 mt-1 rounded-md w-auto text-white">Create New Account</button>

         </div>

        </div>  


  );
};

export default SignUp;
